//# sourceMappingURL=bootstrap.min.js.map
$(document).ready(function(){
    var card = $(".card");
    var fileUri = '';
    var fileName = '';
    var delUrl = "";
    var modUrl = "";
    var funNum = getQueryString('CKEditorFuncNum');
    function getQueryString(name){
        var reg = new RegExp("(^|&)"+name+"=([^&]*)(&|$)","i");
        var result = window.location.search.substr(0).match(reg);
        if(result !== null){
            return result[2];
        }else{
            return null;
        }
    }
    card.click(function(){
        fileUri = $(this).children(".img-thumbnail").attr('src');
        fileName = $(this).children(".img-thumbnail").attr('title');
        card.removeClass('border-primary');
        $(this).addClass('border-primary');
    });
    card.dblclick(function(){
        fileUri = $(this).children(".img-thumbnail").attr('src');
        sure();
    });
    card.hover(function(){
        $(this).addClass('border-primary');
    });
    card.mouseleave(function(){
        if(fileUri === $(this).children(".img-thumbnail").attr('src')){
            return;
        }
        $(this).removeClass('border-primary');
    });
    $(".btn-danger").click(function(){
        if(undefined === fileUri || '' === fileUri){
            alert("");
            return false;
        }
        delUrl = $(this).attr('data-action');
        $.ajax({
            type: 'delete',
            dataType: 'json',
            url: delUrl,
            data: {
                fileName: fileUri
            },
            error: function (XMLHttpRequest, textStatus, errorThrown) {
                // 
                console.log(XMLHttpRequest.status);
                // 
                console.log(XMLHttpRequest.readyState);
                // 
                console.log(textStatus);
                alert('!');
            },
            success: function(data){
                success('',data);
            }
        } );
    });
    $(".btn-warning").click(function(){
        if(undefined === fileName || '' === fileName){
            alert('!');
            return false;
        }
        modUrl = $(this).attr('data-action');
    });

    $("#modifyModal").on('show.bs.modal',function(){
        $("#name-input").val(fileName);
    });

    $(".modal-footer>.btn-primary").click(function(){
        newName = $("#name-input").val();
        saveModify(newName);
        $("#modifyModal").modal('hide');
    });
    function sure(){
        window.opener.CKEDITOR.tools.callFunction( funNum, fileUri );
        window.close();
    }
    function err(e){
        alert(''+e);
    }
    function success(op,data){
        if(data.status !== 200){
            alert(''+op+'!');
        }else{
            alert(op+'!');
            window.location = location.href;
        }
    }
    function saveModify(newFileName){
        $.ajax({
            type: 'post',
            dataType: 'json',
            url: modUrl,
            data: {
                filePath: fileUri,
                fileName: newFileName
            },
            error: function(data){
                err(data);
            },
            success: function(data){
                success('',data);
            }
        } );
    }
});




